import React, {Component} from "react";
import "./Report.css"
import ActiveProj from "./activeProj/activeProj";

class Report extends Component {

    state = {
        projects: [
            {
                names: [
                    {text: 'Проект №1'},
                    {text: 'Проект №2'},
                    {text: 'Проект №3'},
                    {text: 'Проект №4'}
                ]
            }
        ]
    }

    render() {
        return (
            <div className="container">

                <div>
                    <ActiveProj
                        names={this.state.projects[0].names}
                    />
                </div>

                <div className="Kurator">
                    Куратор
                    <div className="nameK">

                    </div>
                </div>


                <div className="ProjStart">
                    Начало
                    <input type="date" id="start" className="proj-start"
                           value="2020-03-22"
                           min="2018-01-01" max="2020-12-31"/>
                </div>

                <div className="ProjEnd">
                    Завершение
                    <input type="date" id="end" className="proj-end"
                           value="2020-05-15"
                           min="2018-01-01" max="2020-12-31"/>
                </div>

                <div className="UseTime">
                    Потраченное
                    <br/>время
                    <input className="time" placeholder={"Введите количество часов"}/>

                </div>

                <div className="Repr">
                    Отчет
                    <textarea className="rep"/>
                </div>


            </div>
        )
    }
}

export default Report;
